import {LitElement, html, css} from "https://unpkg.com/lit-element@2.0.1/lit-element.js?module";

class TommyHomeShutterMaxi extends LitElement {
  
  setConfig(config) {
    this._config = config;
    this.maxPosition = 137;
    this.minPosition = 19;
    this.tapparella = 'cover.salotto'
  }

  static get properties() {
    return {
      hass: {},
      _config: {},
    };
  }


  render() {

    const gruppoTapp = this.hass.states['group.interblocco_tapparelle'].state;
    const cardNascosta = gruppoTapp == 'off' || (gruppoTapp == 'on' && this.hass.states['input_boolean.servizi_condizionatore'].state == 'on')  ? true : false;
    
    const nomeTapp = this.rilevaTapp();
    const sfondoImg = this.scegliSfondo(nomeTapp);
    const tappCucina = nomeTapp == 'cover.porta_cucina' ? true : false;

    const statoTapp = nomeTapp == 'vuota' ? '' : this.hass.states[nomeTapp].state;
    const tappInChiusura = statoTapp == 'closing' ? true : false;
    const tappInApertura = statoTapp == 'opening' ? true : false;
    const tappInMovimento = tappInApertura || tappInChiusura ? true : false;
    const percentTapp = nomeTapp == 'vuota' ? 'unknown' : this.hass.states[nomeTapp].attributes.current_position;

    const posizBordo = nomeTapp == 'vuota' ? 0 : this.setPosizDaPercent(percentTapp, 'bordo');
    const posizBordoTouch = nomeTapp == 'vuota' ? 0 : this.setPosizDaPercent(percentTapp, 'touch');
    const posizRotolante = nomeTapp == 'vuota' ? 0 : this.setPosizDaPercent(percentTapp, 'rotolante');

    const bordoSelezionato = this.hass.states['input_boolean.home_shutter_bordo'].state == 'on' ? true : false;
    const allarmeInserito = this.hass.states['switch.allarme_inserito'].state == 'on' ? true : false;
    
    return html`
 
    <ha-card @touchend="${this.mouseUp}" @mouseup="${this.mouseUp}" @touchmove="${bordoSelezionato ? this.mouseMove : ''}" @mousemove="${bordoSelezionato ? this.mouseMove : ''}" style = "${cardNascosta ? 'display: none' : ''}; ${nomeTapp == 'cover.finestra_martina' ? 'background-image: radial-gradient(#b958b4c0, #6411619d);' : 'background-image: radial-gradient(#58aa89af, #0b2814ba);'}">
    
      <div class="top">     
        <div class="grafica">     
          <div class="grafica-immagine" id="id-immagine" style="background-image: ${sfondoImg}; width: ${tappCucina ? '85px' : '153px'}">   
            <div class="grafica-rotolante" id="id-rotolante" style="height:${posizRotolante}; left:${tappCucina ? '5px' : '8px'}; width: ${tappCucina ? '75px' : '136px'}"></div>    
            <div class="grafica-bordo" id="id-bordo" style="top:${posizBordo}; left:${tappCucina ? '5px' : '8px'}; width: ${tappCucina ? '75px' : '136px'}"></div>    
            <div class="grafica-bordo-touch" id="id-bordo-touch" style="top:${posizBordoTouch}; width: ${tappCucina ? '75px' : '136px'}" @touchstart="${this.mouseDown}" @mousedown="${this.mouseDown}" ></div>
            <div class="grafica-frecce" style = "${!tappInMovimento ? 'display:none' : ''}">                   
              <ha-icon class="grafica-freccia-apri" style = "${!tappInApertura ? 'display:none' : ''}" icon="mdi:arrow-up-bold"></ha-icon>    
              <ha-icon class="grafica-freccia-chiudi" style = "${!tappInChiusura ? 'display:none' : ''}" icon="mdi:arrow-down-bold"></ha-icon>    
            </div>
          </div>
        </div>

        <div class="comandi">    
          <ha-icon-button class="comandi btn-comando-apri" style="${tappInMovimento ? 'display:none' : ''}" @click=${() => this.azionaTapp("open_cover", nomeTapp, allarmeInserito)}><ha-icon class= "icon-frecce-azione" icon="mdi:arrow-up-bold"></ha-icon></ha-icon-button>
          <ha-icon-button class="comandi btn-comando-stop" @click=${() => this.azionaTapp("stop_cover", nomeTapp, allarmeInserito)}><ha-icon class= "icon-frecce-azione" style="${tappInMovimento ? 'color: red' : ''}" icon="mdi:stop"></ha-icon></ha-icon-button>   
          <ha-icon-button class="comandi btn-comando-chiudi" style="${tappInMovimento ? 'display:none' : ''}" @click=${() => this.azionaTapp("close_cover", nomeTapp, allarmeInserito)}><ha-icon class= "icon-frecce-azione" icon="mdi:arrow-down-bold"></ha-icon></ha-icon-button>
        </div>
      </div>

    </ha-card>  

    `;
  };



  rilevaTapp() {
    let gruppoTapp = ['cover.porta_cucina', 'cover.finestra_cucina', 'cover.finestra_salotto', 'cover.finestra_martina', 'cover.finestra_camera', 'cover.finestra_bagno', 'cover.finestra_attilio'];
    let gruppoBool = ['input_boolean.porta_cucina_shutter', 'input_boolean.finestra_cucina_shutter', 'input_boolean.finestra_salotto_shutter', 'input_boolean.finestra_martina_shutter', 'input_boolean.finestra_camera_shutter', 'input_boolean.finestra_bagno_shutter', 'input_boolean.finestra_attilio_shutter'];
    let qualeBool = gruppoBool.findIndex(tapp => this.hass.states[tapp].state == 'on');
    let qualeTapp = '';
    if (qualeBool == -1) {
      qualeTapp = 'vuota';
    } else {
      qualeTapp = gruppoTapp[qualeBool];
    }
    return qualeTapp;
  };


  rilevaServizi(tapp) {
    if (tapp == 'cover.finestra_martina') {
      return false;
    } else {
      return true;
    }
  };  


  azionaTapp(servizio, entita, allarme) {
    if (!allarme) {      
      this.hass.callService("cover", servizio, { entity_id: entita });
    } 
  };



  mouseDown(e) {
    if (e.cancelable) {
      e.preventDefault();
    }
    
    this.hass.callService("input_boolean", "turn_on", { entity_id: "input_boolean.home_shutter_bordo" });
    this.shadowRoot.getElementById("id-bordo").style.height = '5px';
    this.shadowRoot.getElementById("id-bordo").style.border = '1px solid white';
  };


  mouseUp(e) {
    
    this.hass.callService("input_boolean", "turn_off", { entity_id: "input_boolean.home_shutter_bordo" });
    this.shadowRoot.getElementById("id-bordo").style.height = '20px';
    this.shadowRoot.getElementById("id-bordo").style.border = '0px';
    let newPosition = e.pageY - this.trovaTopImmagine(this.shadowRoot.getElementById("id-immagine"));
    let newPositionX = e.pageX;
    let pictureRight = this.trovaRightImmagine(this.shadowRoot.getElementById("id-immagine"));
    
    if (newPositionX <= pictureRight) {
      if (newPosition < this.minPosition)
        newPosition = this.minPosition;
      if (newPosition > this.maxPosition)
        newPosition = this.maxPosition;

      let tapparella = this.rilevaTapp();
      let percentagePosition = 100 - (Math.round((newPosition - this.minPosition) * (100) / (this.maxPosition - this.minPosition)));
              
      if (this.hass.states['switch.allarme_inserito'].state == 'off') {
        this.hass.callService("cover", "set_cover_position", { entity_id: tapparella, position: percentagePosition });
      }
    };  
  };


  mouseMove(e) {
      let nuovaPosiz = e.pageY - this.trovaTopImmagine(this.shadowRoot.getElementById("id-immagine"));
      if (nuovaPosiz < this.minPosition)
        nuovaPosiz = this.minPosition;
  
      if (nuovaPosiz > this.maxPosition)
        nuovaPosiz = this.maxPosition;
      
      this.shadowRoot.getElementById("id-bordo").style.top = nuovaPosiz + 'px';
      this.shadowRoot.getElementById("id-bordo-touch").style.top = nuovaPosiz -10 + 'px';
      this.shadowRoot.getElementById("id-rotolante").style.height = nuovaPosiz - this.minPosition + 'px';
  };


  trovaTopImmagine(picture) {
    let pictureBox = picture.getBoundingClientRect();
    let body = document.body;
    let docEl = document.documentElement;
    let scrollTop = window.pageYOffset || docEl.scrollTop || body.scrollTop;
    let clientTop = docEl.clientTop || body.clientTop || 0;
    let pictureTop  = pictureBox.top + scrollTop - clientTop;
    return pictureTop;
}

  trovaRightImmagine(picture) {
    let pictureBox = picture.getBoundingClientRect();
    let body = document.body;
    let docEl = document.documentElement;
    let scrollLeft = window.pageXOffset || docEl.scrollLeft || body.scrollLeft;
    let clientLeft = docEl.clientLeft || body.clientLeft || 0;
    let pictureRight  = pictureBox.right + scrollLeft - clientLeft;
    return pictureRight;
  }


  setPosizDaPercent(percentuale, quale) {

    let tappVisibile = percentuale;
    let posizBordo = (this.maxPosition - this.minPosition) * (100-tappVisibile) / 100 + this.minPosition;
    if (posizBordo < this.minPosition) {
      posizBordo = this.minPosition;
    }
    if (posizBordo > this.maxPosition) {
      position = this.maxPosition;
    }
    if (quale == 'bordo') {
      return posizBordo + 'px';
    } else if (quale == 'rotolante') {
        return posizBordo - this.minPosition + 'px';
    } else {
        return posizBordo - 10 + 'px';
    }
  };


  scegliSfondo(tapp) {
    switch (tapp) {
      case 'cover.porta_cucina':
        return 'url(data:@file/png;base64,)';
      case 'cover.finestra_salotto':
        return 'url(data:@file/png;base64,)';
      case 'cover.finestra_cucina':
        return 'url(data:@file/png;base64,)';
      case 'cover.finestra_martina':
        return 'url(data:@file/png;base64,)';
      case 'cover.finestra_camera':
        return 'url(data:@file/png;base64,)';
      case 'cover.finestra_bagno':
        return 'url(data:@file/png;base64,)';
      case 'cover.finestra_attilio':
        return 'url(data:@file/png;base64,)';
      case 'vuota':
        return 'url(data:@file/png;base64,)';
    }
  };



  static styles = css`
  
    ha-card {
      background: #00000000;
      background-image: radial-gradient(#58aa89af, #0b2814ba);
      height: 200px;
      border: 0px;
    }

    .top {
      position: absolute;
      top: 10px;
      left: 10px;
      right: 10px;
      height: 180px; 
      display: flex; 
      flex-flow: row nowrap; 
      align-items: center; 
      justify-content: space-around;
    }  

    .bottom {
      position: absolute;
      top: 171px;
      left: 10px;
      right: 10px;
      height: 89px; 
      border: 1px solid purple;
      display: flex; 
      flex-flow: row nowrap; 
      align-items: center; 
      justify-content: space-around;
    }  
    
    .grafica {
      height: 153px;

    }
    .grafica-immagine {
      height: 151px; 
      position: relative; 
      margin: auto; 
      background-size: 100% 100%;
    }

    .grafica-rotolante {
      position: absolute; 
      top: 19px; 
      height: 0;
      background-image: url(data:@file/png;base64,);
    }

    .grafica-bordo {
      position: absolute; 
      top: 19px; 
      left: 8px; 
      width: 88%; 
      height: 20px; 
      background-repeat: no-repeat;
      background-image: url(data:@file/png;base64,);
    }

    .grafica-bordo-touch {
      position: absolute; 
      top: 19px; 
      left: 8px; 
      cursor: pointer; 
      height: 30px; 
      background-color: #03131c00;
    }

    .comandi {
      height: 150px;
      display: flex; 
      justify-content: space-between;
      flex-flow: column nowrap;
      text-align: center; 
      max-width: 100%;
    }

    .btn-comando-apri, .btn-comando-chiudi, .btn-comando-stop {
      
      background: #00000000;
      background-image: radial-gradient(#2b2b2bb9, #a3a2a268);
      width: 36px;
      height: 36px;
      border: 1px solid #a7a7a7b3;
      border-radius: 18px;
      text-align: center;
    }
  
    .grafica-frecce {
      position: absolute; 
      display: flex; 
      flex-flow: column nowrap;
      left: 6%;  
      top: 50%;
      width: 88%; 
      height: 118px;
      background-color: #03131c00; text-align: center; 
    }

    .grafica-freccia-apri, .grafica-freccia-chiudi {
      transform: translateY(-50%);
      color: red;
      --mdc-icon-size: 80px;
    }

    .icon-frecce-azione {
      --mdc-icon-size: 30px;
      transform: translate(-20%, -20%);
      color: #e4e4e4;
    }

  `
  ;

}

customElements.define("tommy-home-shutter-maxi", TommyHomeShutterMaxi);